    return(
        <div className="shop-header">
            <div className="shop-header-icons">
                <a><FontAwesomeIcon icon={["fas", "user"]}/></a>
                <FontAwesomeIcon icon={["fas", "shopping-bag"]}/>
            </div>
        </div>
    )
}

export default ShopHeader
